import Link from "next/link";
import { Avatar } from "@material-ui/core";
import AccessTimeIcon from "@material-ui/icons/AccessTime";
import SearchIcon from "@material-ui/icons/Search";
import HelpOutlineIcon from "@material-ui/icons/HelpOutline";

const Header = () => (
  <div className="header">
    <div className="header__left">
      <Avatar className="header__avatar" alt={"ref"} src={""} />
      <AccessTimeIcon className="header__time-icon" />
      {/* Time Icon */}
    </div>
    <div className="header__search">
      <SearchIcon />

      <input placeholder="Search Clever Programmer" />

    </div>
    <div className="header__right">
      <HelpOutlineIcon className="header__help-icon" />
    </div>
    <style jsx>{`
        .header {
          display: flex;
          align-items: center;
          justify-content: space-between;
          padding: 10px 0;
          background-color: var(--primary-color);
          color: white;
        }

        .header__left {
          flex: 0.3;
          display: flex;
          align-items: center;
          margin-left: 20px;
        }

        .header__time-icon {
          background-color: gray;
          margin-left: 20px;
          margin-right: auto;
        }

        .header__search {
          flex: 0.4;
          background-color: #421f44;
          text-align: center;
          display: flex;
          padding: 0 50px;
          color: gray;
          border: 1px gray solid;
          border-radius: 6px;
        }

        input {
          background-color: transparent;
          border: none;
          text-align: center;
          min-width: 35vw;;
        }

        .header__right {
          flex: 0.3;
          display: flex;
          align-items: flex-end;
        }

        .header__help-icon {
          margin-left: auto;
          margin-right: 20px;
        }
      `}
    </style>
  </div>
);

export default Header;
